script: |
  super -f tsv -I q2602.sql | sort > q2602.out

vector: true

inputs:
  - name: q2602.sql
    data: |
      SELECT a-b
      FROM t1
      WHERE (e>c OR e<d)
      AND a>b
      AND d NOT BETWEEN 110 AND 150;
  - name: t1

outputs:
  - name: q2602.out
    data: |
      1
      1
      1
      2
      2
      2
      2
      3
      3
      4
